class NavBar extends React.Component{

    render() {
        return (
            <div id="navbar">
                <span id="title">minhee kang</span>
                    <button >welcome</button> 
                    <button >work</button>
                    <button >contact</button>
                    <button >about</button>
                <div>
                </div>
            </div>
        )
    }
}

export default NavBar
